import java.util.*;

public class WordSearch {

    class Node {
        public int x;
        public int y;

        public Node(int x, int y) {
            this.x = x;
            this.y = y;
        }

        @Override
        public boolean equals(Object o) {
            if (this == o) return true;
            if (o == null || getClass() != o.getClass()) return false;
            Node node = (Node) o;
            return x == node.x &&
                    y == node.y;
        }

        @Override
        public int hashCode() {
            return Objects.hash(x, y);
        }
    }

    class Status {
        public List<Node> path;
        public int index;

    }

    public void printStatus(Status s) {
         System.out.println("index: " + s.index);
         System.out.print("path: ");
         for (Node n : s.path) {
             System.out.print("(" + n.x + ", " + n.y + ") ");
         }
         System.out.println();
         System.out.println();
    }

    public boolean whetherWordExist(char[][] board, String word, int x, int y) {
        if (board[x][y] != word.charAt(0)) {
            return false;
        }

        Node startNode = new Node(x, y);
        Status startStatus = new Status();
        startStatus.path = new ArrayList<>();
        startStatus.path.add(startNode);
        startStatus.index = 0;

        Queue<Status> q = new LinkedList<>();
        q.add(startStatus);
        printStatus(startStatus);

        while (!q.isEmpty()) {

            Status curr = q.poll();
            int size = curr.path.size();
            Node tailOfPath = curr.path.get(size - 1);
            int currX = tailOfPath.x;
            int currY = tailOfPath.y;
            int currPosition = curr.index;

            if (currPosition >= word.length() - 1) {
                return true;
            }

            int[] directionsX = new int[]{0, -1, 0, +1};
            int[] directionsY = new int[]{-1, 0, +1, 0};

            for (int i = 0; i < 4; i++) {
                int newX = currX + directionsX[i];
                int newY = currY + directionsY[i];

                Node nextNode = new Node(newX, newY);
                Status next = new Status();
                if (0 <= newX && newX < board.length
                        && 0 <= newY && newY < board[0].length
                        && !curr.path.contains(nextNode)
                        && board[newX][newY] == word.charAt(currPosition + 1)) {
                    next.path = new ArrayList<>(curr.path);
                    next.path.add(nextNode);
                    next.index = currPosition + 1;
                    q.add(next);
                    printStatus(next);
                }
            }
        }
        return false;
    }

    public List<String> findWords(char[][] board, String[] words) {
        List<String> res = new ArrayList<>();
        for (String s : words) {
            for (int i = 0; i < board.length; i++) {
                for (int j = 0; j < board[i].length; j++) {
                    if (whetherWordExist(board, s, i, j)) {
                        res.add(s);
                    }
                }
            }
        }
        return res;
    }

    public static void main(String[] args) {
        char[][] board = new char[][] {
                {'o','a','a','n'},
                {'e','t','a','e'},
                {'i','h','k','r'},
                {'i','f','l','v'}
        };
        String[] words = new String[] {"oath","pea","eat","rain"};
        WordSearch ws = new WordSearch();
        List<String> res = ws.findWords(board, words);
        System.out.println(res);

        System.out.println("aaaaaaaaaaaaaaab".length());

    }
}

